import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
// import calculators from "./data/calculators"; // Import data file
import Calculator from "./Calculator"; // Importing Calculator component
import Home from "./pages/Home";
import ContactUs from "./pages/ContactUs";
import AskUs from "./pages/AskUs";
import Market from "./pages/Market";
import Login from "./pages/Login";
import Signup from "./pages/Signup";
import "./App.css";

function App() {
  return (
    <Router>
      <div className="navbar">
        <div className="navbar-left">
          <h1>My Portfolio</h1>
        </div>
        <div className="navbar-right">
          <Link to="/">Home</Link>
          <Link to="/Calculator">Calculator</Link>
          <Link to="/ContactUs">Contact Us</Link>
          <Link to="/AskUs">Ask Us</Link>
          <Link to="/Market">Market</Link>
          <Link to="/Login">Login</Link>
          <Link to="/Signup">Sign Up</Link>
        </div>
      </div>

      {/* Routes */}
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/Calculator" element={<Calculator />} />
        <Route path="/ContactUs" element={<ContactUs />} />
        <Route path="/AskUs" element={<AskUs />} />
        <Route path="/Market" element={<Market />} />
        <Route path="/Login" element={<Login />} />
        <Route path="/Signup" element={<Signup />} />

        {/* Dynamically generated calculator routes */}
        {calculators.map((calc, index) => (
          <Route key={index} path={calc.link} element={<h1>{calc.label} Page</h1>} />
        ))}
      </Routes>
    </Router>
  );
}

export default App;
